  const { photos, setPhotos } = useContext(context);

  console.log(photos)

  return (
    <div>
      <h1>Fotos favoritas</h1>
      <div className="p-3 galeria grid-columns-4">
        {photos.forEach((photo) => {
          if (photo.liked) {
            <div
              className="foto"
              key={photo.id}
              style={{ backgroundImage: `url(${photo.src.medium})` }}
              onClick={() => {
                handleOnClick(photo.id);
              }}
            >
              <p>{photo.alt}</p>
            </div>;
          }
        })}
      </div>
    </div>
  );
}
